import{_ as a}from"./sommerfest_02.257d6329.js";import{_ as t,o as s,c as h,b as n,d as u,a as r,e,r as d}from"./app.980f145b.js";var l="/aktivitaeten/GLUEHWEINPOTA-2023/Winter1.jpg",c="/aktivitaeten/GLUEHWEINPOTA-2023/Winter3.jpg",o="/aktivitaeten/GLUEHWEINPOTA-2023/Winter4.jpg",g="/aktivitaeten/GLUEHWEINPOTA-2023/Winter5.jpg",m="/aktivitaeten/GLUEHWEINPOTA-2023/Winter6.jpg",k="/aktivitaeten/GLUEHWEINPOTA-2023/Winter2.jpg",f="/aktivitaeten/GLUEHWEINPOTA-2023/Jugend1.jpg",p="/aktivitaeten/GLUEHWEINPOTA-2023/Jugend2.jpeg",b="/aktivitaeten/GLUEHWEINPOTA-2023/Contest1.jpg",w="/aktivitaeten/GLUEHWEINPOTA-2023/Contest2.jpg";const _={},v=r('<h1 id="gluhwein-pota-jahresruckblick" tabindex="-1"><a class="header-anchor" href="#gluhwein-pota-jahresruckblick" aria-hidden="true">#</a> Gl\xFChwein-POTA &amp; Jahresr\xFCckblick</h1><p>Das Jahr 2023 neigt sich dem Ende zu, und die Draussenfunker haben sich im Hammer Park in Hamburg zum j\xE4hrlichen Gl\xFChwein-POTA getroffen. Knapp 25 Funkamateuere haben sich auf den Weg gemacht, um bei Gl\xFChwein, Stollen und Chilli sin Carne einen entspannten Tag zu verbringen. <img src="'+l+'" alt="Winter"></p><p>Es wurde wieder gefachsimpelt, der Park mehrfach aktiviert und interessierte Spazierg\xE4nger \xFCber unser Hobby aufgekl\xE4rt. Zu den in unserer Community aktiven Rufzeichen und Namen ein Gesicht zu sehen und sich besser kennen zu lernen, war auch wieder ein tolles Erlebnis. <img src="'+c+'" alt="Winter"><img src="'+o+'" alt="Winter"><img src="'+g+'" alt="Winter"><img src="'+m+'" alt="Winter"></p><p>Mein pers\xF6nliches Highlight waren zwei Spazierg\xE4ngerinnen, die sehr interessiert an dem waren, was wir da machten. Nach einer l\xE4ngeren Einf\xFChrung in den Amateurfunk, unsere Motivation beim Hobby, die vielf\xE4ltigen M\xF6glichkeiten, und die Technik dahinter, wurden mit Ausbildungsrufzeichen die ersten QSOs auf 2m probiert. Alles war neu, das internationale Buchstabieralphabet, das Sprechen ins Mikrofon, all das war aufregend. <img src="'+k+'" alt="Winter"></p><p>Schlussendlich wurde auf Kurzwelle der Park in Rekordzeit aktiviert, von Sch\xFCchternheit am Mikrofon war nichts mehr geblieben, und nach knapp 2 Stunden sind die beiden \xFCbergl\xFCcklich weiter gezogen. Nat\xFCrlich nicht, ohne noch ein paar Hinweise \xFCber Ausbildungsm\xF6glichkeiten und die Lizenzen mit auf den Weg zu bekommen.</p><p>Alles in allem wurden knapp 200 QSOs geloggt, viele tolle Gespr\xE4che gef\xFChrt, Antennen ausprobiert, Kekse, Gl\xFChwein und Chilli gegessen, und einige Freundschaften geschlossen. - So muss es sein!</p><p>Vielen Dank an alle, die sich auf den Weg gemacht haben. Die weiteste Anreise hatte ein OM aus Nordbayern.</p><h3 id="jahresruckblick" tabindex="-1"><a class="header-anchor" href="#jahresruckblick" aria-hidden="true">#</a> Jahresr\xFCckblick</h3><p>Unsere Kleine Gemeinschaft ist mittlerweile auf mehr als 200 Funkamateure und Interessierte angewachsen. Wir haben auch dieses Jahr wieder tolle Dinge gemacht.</p><h4 id="sommerfest" tabindex="-1"><a class="header-anchor" href="#sommerfest" aria-hidden="true">#</a> Sommerfest</h4>',10),A=e("Dieses Jahr haben wir ein Sommerfest in einem Hamburger Park veranstaltet. Analog zum Gl\xFChwein-POTA, trafen wir uns im Park, haben diesen gemeinsam aktiviert, gegessen, getrunken und eine kleine Fuchsjagd veranstaltet. Auch hier wurden wir wieder von interessierten Passanten angesprochen und konnten einige davon (u.a. ein junges M\xE4dchen) von unserem Hobby begeistern. Hierbei haben sich PMR-Ger\xE4te f\xFCr den schnellen Einstieg und das Ausprobieren durch Kinder mehr als bew\xE4hrt. "),E=n("img",{src:a,alt:"Sommerfest"},null,-1),W=e(" Mehr Infos und Bilder "),z={href:"https://draussenfunker.de/aktivitaeten/2023-08-26-Sommerfest.html",target:"_blank",rel:"noopener noreferrer"},D=e("hier"),H=e("."),P=r('<h4 id="funktag-in-kassel" tabindex="-1"><a class="header-anchor" href="#funktag-in-kassel" aria-hidden="true">#</a> Funktag in Kassel</h4><p>In Kassel haben sich knapp 5-7 Draussenfunker getroffen, gekl\xF6nt und nach dem Flohmarktbesuch noch den eigens daf\xFCr eingereichten Park aktiviert.</p><h4 id="ausbildung-und-jugendforderung" tabindex="-1"><a class="header-anchor" href="#ausbildung-und-jugendforderung" aria-hidden="true">#</a> Ausbildung und Jugendf\xF6rderung</h4><p>Die Draussenfunker haben dieses Jahr eine geringe zweistellige Anzahl an Handfunkger\xE4ten f\xFCr U23 gesponsort. Wer in Hamburg j\xFCnger als 23 ist, und seine Lizenz besteht, bekommt von uns ein nagelneues Handfunkger\xE4t geschenkt, sofern wir das mitbekommen. Zus\xE4tzlich haben wir angefangen, Pr\xFCfungsgeb\xFChren f\xFCr U23 zu bezuschussen. Dies machen wir aus eigener Tasche und wollen den Bereich im n\xE4chsten Jahr noch ausbauen.</p><p>Ebenfalls haben einige unserer Mitglieder angefangen, Schulkindern das Funken n\xE4her zu bringen. Bereits 2 Workshops haben mit Jugendlichen zwischen 10 und 15 Jahren stattgefunden. Es wurden Antennen gebaut, Funktechnik erkl\xE4rt, und nat\xFCrlich getestet. Die Antennen durften die Kids mit nach Hause nehmen und an ihren Freenet-Ger\xE4ten nutzen. Ein voller Erfolg, der nach weiteren Terminen und Workshops schreit. Auch diesen Aspekt der Jugendf\xF6rderung m\xF6chten wir im n\xE4chsten Jahr weiter ausbauen. <img src="'+f+'" alt="Jugend"><img src="'+p+'" alt="Jugend"></p><h4 id="pota-administration" tabindex="-1"><a class="header-anchor" href="#pota-administration" aria-hidden="true">#</a> POTA Administration</h4><p>Mit Heinrich (DO1HFS), Harm (DK4HAA) und Julius (DO7JZ) hat das deutsche Team von Parks on the Air drei weitere Administratoren anwerben k\xF6nnen. Alle deutschen POTA Admins sind nun aktiver Teil unserer Draussenfunker-Gemeinschaft.</p><h4 id="sammelbestellungen" tabindex="-1"><a class="header-anchor" href="#sammelbestellungen" aria-hidden="true">#</a> Sammelbestellungen</h4><p>Es gab dieses Jahr wieder gemeinsame Sammelbestellungen, u.a. f\xFCr SignalStuff Signalsticks, einer sehr guten Antenne f\xFCr Handfunkger\xE4te aus den USA. Ebenfalls wurden wieder Kits f\xFCr die Draussenfunker 1/4 Vertical und die Draussenfunker EFHW verteilt.</p><h4 id="contest-teilnahme" tabindex="-1"><a class="header-anchor" href="#contest-teilnahme" aria-hidden="true">#</a> Contest-Teilnahme</h4><p>Mehrere OMs der Draussenfunker haben erste Contest-Erfahrungen sammeln k\xF6nnen und gemeinsam an einem Contest teilgenommen. <img src="'+b+'" alt="Contest"><img src="'+w+'" alt="Contest"></p><p>Es wurde jedoch noch so viel mehr erlebt. Es wurde gemeinsam gelacht, geflucht, vielleicht auch geweint. Es wurde gemeinsam geforscht, gelernt, Satelliten-QSOs gefahren, Platinen gel\xF6tet und all die vielen anderen Dinge gemacht, die diese Aufz\xE4hlung sprengen w\xFCrden.</p><p>Auch einen herzlichen Gl\xFCckwunsch an alle, die ihre Pr\xFCfung bestanden haben, oder erfolgreich aufgestockt haben. Und nat\xFCrlich auch einen herzlichen Gl\xFCckwunsch an alle, die dieses Jahr etwas neues probiert haben, sich weiterentwickelt, herausgefordert haben und dabei erfolgreich waren!</p><p>2023 war f\xFCr uns Draussenfunker ein tolles Jahr. Wir konnten viele tolle Weggef\xE4hrten in unserer Gemeinschaft begr\xFC\xDFen, viele tolle Pl\xE4ne und Projekte umsetzen und freuen uns auf 2024 und auf euch!</p><p>Vielen Dank, dass ihr da seid (oder noch dazu kommt?) und unsere Gemeinschaft bereichert!</p><p>73 DO1DSH, DG7PX, DK4HAA, DC1TC, DO7JZ</p><p>Danke f\xFCr die Bilder an DC1TC, DL9PKW, DK4HAA und DK1BOU.</p><hr>',18);function G(S,O){const i=d("ExternalLinkIcon");return s(),h("div",null,[v,n("p",null,[A,E,W,n("a",z,[D,u(i)]),H]),P])}var j=t(_,[["render",G],["__file","2023-12-09-Jahresrueckblick.html.vue"]]);export{j as default};
